const DATA = 'data';
const BUCKET = 'bucket';
const HASH = 'hash';
const KEY = 'key';
const PUBLIC_URL = 'publicUrl';

const BUFFER = 'buffer';

module.exports = {
  GET_OPTIONS: {
    DATA: DATA,
    BUCKET: BUCKET,
    HASH: HASH,
    KEY: KEY,
    PUBLIC_URL: PUBLIC_URL,
  },
  GET_FILE_FROM_HASH_OPTIONS: {
    BUFFER: BUFFER,
  }
};
